import topo_wallis from './coord_wallis'
import topo_tahiti from './coord_tahiti'

const map ={
	"title": "France",
	"version": "2.0.1",
	"type": "FeatureCollection",
	"copyright": "Copyright (c) 2022 Highsoft AS, Based on data from Natural Earth",
	"copyrightShort": "Natural Earth",
	"copyrightUrl": "http://www.naturalearthdata.com",
	"crs": {
		"type": "name",
		"properties": {
			"name": "urn:ogc:def:crs:OGC::WGS84"
		}
	},

	"hc-transform": {
	    "fr-all-wallis": {
            "crs": "+proj=utm +zone=1 +datum=WGS84 +units=m +no_defs",
        },
        "fr-all-tahiti": {
            "crs": "+proj=utm +zone=6 +datum=WGS84 +units=m +no_defs",
        }
    },

	"features": [ 
		{
			"type": "Feature",
			"id": "FR.WAL",
			"properties": {
				"hc-group": "admin1",
				"hc-key": "fr-wal",
				"hc-a2": "WA",
				"name": "Wallis",
				"iso_3166_2": "FR-WAL",
				"hc-middle-x": 0.5,
				"hc-middle-y": 0.5
			},
			"geometry": {
				"type": "MultiPolygon",
				"coordinates": topo_wallis
			}
		},
		{
			"type": "Feature",
			"id": "FR.TAH",
			"properties": {
				"hc-group": "admin1",
				"hc-key": "fr-tah",
				"hc-a2": "TA",
				"name": "Tahiti",
				"iso_3166_2": "FR-TAH",
				"hc-middle-x": 0.5,
				"hc-middle-y": 0.5
			},
			"geometry": {
				"type": "MultiPolygon",
				"coordinates": topo_tahiti
			}
		},
		{
			"type": "Feature",
			"properties": {
				"hc-group": "__separator_lines__"
			},
			"geometry": {
				"type": "MultiLineString",
				"coordinates": [
					[
						[904, 253],
						[7464, 253]
					],
					[
						[904, -999],
						[7464, -999]
					],
					[
						[2390, 136],
						[2390, -689]
					],
					[
						[6000, 136],
						[6000, -689]
					],
					[
						[4745, 136],
						[4745, -689]
					],
					[
						[3530, 136],
						[3530, -689]
					]
				]
			}
		}
	]
}

export default map
